import { createContext, useContext } from "react";

export const AdminContext = (v1, v2, v3, v4, v5) =>{
    createContext({
    isLoggedIn: v1,
    auth: v2,
    token: v3,
    admin_id:v4,
    username: v5,
})
};

export const useAdminContext = () => useContext(AdminContext);
